import {useEffect, useState} from 'react';

export default function Focused(props) {

  const renderFocusedList = () => {
    return props.focused.map((i, item) => (
      <div key={`F${item}`}>{i[0].resources[0].data.name}</div>
    ))
  }

  return (
    <div style={{
      position: "absolute", 
      width: "33vw", 
      height: "85.5vh", 
      left: "65.5vw",
      top: "9.2vh"
    }}>{renderFocusedList()}</div>
  )
}
